// App.js
import React from 'react';
import BgVideo from './components/BgVideo';
import NavBar from './components/NavBar';
import LoginForm from './components/LoginForm';
function App() {
  return (
    <div className="app">
      <NavBar />
      <BgVideo />
      <LoginForm />
    </div>
  );
}

export default App;
